/**
 * @param {number[]} nums
 * @return {number}
 */
var minimumIndex = function(nums) {
    let dominant = nums[0], count = 1;
    for (let i = 1; i < nums.length; i++) {
        if (nums[i] === dominant) count++;
        else count--;
        if (count === 0) {
            dominant = nums[i];
            count = 1;
        }
    }

    let totalFreq = 0, validSplitFreq = 0, index = -1;
    for (let i = 0; i < nums.length; i++) {
        if (nums[i] === dominant) totalFreq++;
    }

    for (let i = 0; i < nums.length - 1; i++) {
        if (nums[i] === dominant) validSplitFreq++;
        if (validSplitFreq * 2 > i + 1 && (totalFreq - validSplitFreq) * 2 > nums.length - i - 1) {
            index = i;
            break;
        }
    }

    return index;
};
